import React from "react";
import "./css/home.css"
import Login from "../login/login";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function About(){
    return (
        <div>
            <section class="about">
                <div class="main">
                    <div class="about-text">
                        <h2>About Us</h2>
                        <h5>Scan <span>& Save</span></h5>
                        <p>Blah Blah Blah</p>
                        <button type="button">Let's Talk</button>
                    </div>
                </div>
            </section>
        </div>
    )
}

function GetStarted(){
    return (
        <div class="content">
            <h4>We are</h4>
            <h1>Cash<span>UwU</span></h1>
            <h3>Snap Once. Save More.</h3>
            <div class="newslatter">
                <form>
                    <input type="email" name="email" id="mail" placeholder="Enter Your Email"/>
                    <input type="submit" name="submit" value="Lets Start"/>
                </form>
            </div>
        </div>
    )
}


function HomeHero(){
    return(
        <section id = "header">
            <h2 class="logo">Cash<span>UwU</span></h2>
            <div>
                <ul id ="navbar">
                    <li><a class="active" href="home.html">Home</a></li>
                    <li><a href="about.html">About Us</a></li>
                    <li><a href="contact.html">Contact Us</a></li>
                    <Link to={"./Login"}>
                        <button class="btn" >Login</button>;
                    </Link>
                </ul>
            </div>

        </section>


    )
}

function HomeFooter(){
    return (
        <footer>
            {/* <p>For more HTML, CSS, and coding tutorial - please click on the link below to subscribe to my channel:</p>  */}
            <div class="social">
                <a href="#">F<i class="fab fa-facebook-f"></i></a>
                <a href="#">I<i class="fab fa-instagram"></i></a>
                <a href="#">D<i class="fab fa-dribbble"></i></a>
            </div>
        </footer>
    )
}
export default function Home(){
    return (

        <body>
            <><Router>
      <Route path="/login" component={Login} />
        </Router><Home /></>
            <GetStarted />
            <HomeFooter />
            <About />

        </body>

    )
}
